import { Container, Form, Card, Button } from 'react-bootstrap'
import React, { ChangeEvent, useState } from 'react';
import { loginApi } from '../httpApi/UserApi';

const Auth = () => {

    const [name, setName] = useState("");
    const [pwd, setPwd] = useState("");

    const click = async () => {
        const response = await loginApi(name, pwd);
        const { jwtHash } = response.data;

        console.log(jwtHash);
    }
    return (
        <Container>
            <Card>
                <h2>Авторизация</h2>
                <Form>
                    <Form.Control placeholder='Введите имя' value={name} onChange={(e: ChangeEvent<HTMLInputElement>) => setName(e.target.value)} />
                    <Form.Control placeholder='Введите пароль' value={pwd} onChange={(e: ChangeEvent<HTMLInputElement>) => setPwd(e.target.value)} />
                    <Button onClick={click}>Войти</Button>

                </Form>
            </Card>
        </Container>
    );
};

export default Auth;
